
var bitmap  = '';
var SIZE    = 40;
var extend  = function(trg) {
    var i, j, len, src;

    for (j = 1, len = arguments.length; j < len; j++) {
        src     = arguments[j];
        for (i in src) {
            trg[i] = src[i];
        }
    }
};

var bind = function(fn, scope) {
    return function() {
        return fn.apply(scope, arguments);
    }
};

var frame2position = function(frame) {
    var fsize       = 40,
        perLine     = 16,
        inx         = frame % 16,
        row         = (frame - inx) / perLine;

    return [
        inx * fsize,
        row * fsize
    ];

};

var getRandomInt = function(min, max) {
    return Math.floor(Math.random() * (max - min)) + min;
}

var cssInitialized = false;

var addCSSRule = function(sheet, selector, rules, index) {
    if(sheet.insertRule) {
        sheet.insertRule(selector + "{" + rules + "}", index);
    }
    else {
        sheet.addRule(selector, rules, index);
    }
};

var initCSS = function() {

    var style = document.createElement("style");
    style.appendChild(document.createTextNode(""));
    document.head.appendChild(style);

    var sheet = style.sheet,
        rule;

    rule = [
        'position: absolute;',
        'width: 40px;',
        'height: 40px;',
        'background-image: url(data:image/png;base64,'+bitmap+');',
        'background-repeat: no-repeat;',
        'z-index: 9999'
    ];
    addCSSRule(sheet, ".sheep-js", rule.join(" "), 0);

    rule = [
        '-moz-transform: scaleX(-1);',
        '-o-transform: scaleX(-1);',
        '-webkit-transform: scaleX(-1);',
        'transform: scaleX(-1);',
        'filter: FlipH;',
        '-ms-filter: "FlipH";'
    ];
    addCSSRule(sheet, ".sheep-js-reversed", rule.join(" "), 1);

};

var inArray = function(arr, item) {
    var i, len;
    for (i = 0, len = arr.length; i < len; i++) {
        if (arr[i] == item) {
            return true;
        }
    }
    return false;
};

var addListener = function(el, event, func) {
    if (el.addEventListener) {
        el.addEventListener(event, func, false);
    } else if (el.attachEvent)  {
        el.attachEvent('on' + event, func);
    }
};

var removeListener = function(el, event, func) {
    if (el.removeEventListener) {
        el.removeEventListener(event, func);
    } else if (el.detachEvent)  {
        el.detachEvent('on' + event, func);
    }
};

var isArray = function(value) {
    return value && typeof value == 'object' && typeof value.length == 'number' &&
           toString.call(value) == '[object Array]' || false;
};

var setFrame = function(el, inx) {
    var xy      = frame2position(inx),
        style   = el.style;

    style.backgroundPosition = '-' + xy[0] + 'px -' + xy[1] + 'px';
};

var isVisible = function(el) {
    return !(el.offsetWidth <= 0 || el.offsetHeight <= 0);
};

var isReachable = function(el) {

    if (el === window) {
        return true;
    }

    if (!isVisible(el)) {
        return false;
    }

    var rect    = getClientRect(el),
        wrect   = getClientRect(window);

    if (rect.floor < wrect.top + SIZE) {
        return false;
    }
    if (rect.floor > wrect.floor) {
        return false;
    }
    if (rect.left < wrect.left) {
        return false;
    }
    if (rect.right > wrect.right) {
        return false;
    }

    return true;
};

var getClientRect = function(el) {

    var rect;

    if (el === window) {

        var doc = document.documentElement;

        rect = {
            left: 0,
            right: doc.clientWidth,
            top: getScrollTop(),
            bottom: doc.clientHeight + getScrollTop(),
            width: doc.clientWidth,
            isWin: true,
            floor: doc.clientHeight + getScrollTop()
        };
    }
    else {
        rect = el.getBoundingClientRect();
        rect.isWin = false;
        rect.floor = rect.top + getScrollTop();
        rect.width = rect.right - rect.left;
    }

    rect.getCenter = function() {
        return this.width / 2;
    };

    rect.getCenterX = function() {
        return this.left + this.width / 2;
    };

    return rect;
};

var getScrollTop = function() {
    if(typeof window.pageYOffset!= 'undefined'){
        //most browsers except IE before #9
        return window.pageYOffset;
    }
    else{
        var B= document.body; //IE 'quirks'
        var D= document.documentElement; //IE with doctype
        D= (D.clientHeight)? D: B;
        return D.scrollTop;
    }
};

var Sheep   = function Sheep(options) {

    if (!cssInitialized) {
        initCSS();
    }

    var self        = this;

    self._observable    = new MetaphorJs.lib.Observable;
    extend(self, self._observable.getApi());

    self.tickDelegate   = bind(self.tick, self);

    self.action     = new Action(self);
    self.position   = new Position(self, options.floors || "window");

    self.position.on("bounding", self.onBounding, self);
    self.action.on("end", self.onActionEnd, self);

    self.mouseDownDelegate  = bind(self.onMouseDown, self);
    self.mouseUpDelegate    = bind(self.onMouseUp, self);
    self.mouseMoveDelegate  = bind(self.onMouseMove, self);

    self.createElem();

    self.trigger("init");

    self.activate();
};

extend(Sheep.prototype, {

    elem: null,
    direction: "l",
    position: null,
    action: null,
    actionId: null,
    auto: false,

    ofsX: null,
    ofsY: null,
    dragging: false,

    getDirection: function() {
        return this.direction;
    },

    getAction: function() {
        return this.action;
    },

    getPosition: function() {
        return this.position;
    },

    getElem: function() {
        return this.elem;
    },

    activate: function() {
        var self    = this;
        if (!self.actionId) {
            self.position.setFloor(window);
            self.setAction("meteor");
            requestAnimationFrame(self.tickDelegate);
            self.start();
        }
    },

    start: function() {
        var self = this;
        if (!self.actionId) {
            self.findNewAction();
        }
        self.auto = true;
    },

    stop: function() {
        var self = this;
        self.auto = false;
        self.action.end();
        self.actionId = null;
        self.position.stopAnimation();
    },

    tick: function() {
        var self = this;
        self.trigger("tick", (new Date).getTime());
        requestAnimationFrame(self.tickDelegate);
    },

    setAction: function(id) {
        var self    = this;
        self.action.stop();
        self.actionId = id;
        self.action.setup(actions[id], id);
        self.action.run();
    },

    changeDirection: function() {

        var self    = this;

        if (self.direction == "l") {
            self.elem.className = "sheep-js sheep-js-reversed";
            self.direction = "r";
        }
        else {
            self.elem.className = "sheep-js";
            self.direction = "l";
        }
    },

    findNewAction: function() {

        var self    = this,
            newInx  = getRandomInt(0, actionIds.length),
            id      = actionIds[newInx],
            action  = actions[id],
            another = function() {
                window.setTimeout(function(){
                    self.findNewAction();
                }, 0);
            };

        if (self.action.nextAction) {
            self.setAction(self.action.nextAction);
            return null;
        }

        if (self.actionId == id || action.notAfter == id) {
            return another();
        }

        if (action.isPossible && !action.isPossible(self)) {
            return another();
        }

        if (action.probability && Math.random() > action.probability) {
            return another();
        }

        if (action.notAfter && inArray(action.notAfter, self.actionId)) {
            return another();
        }

        if (action.onlyAfter && !inArray(action.onlyAfter, self.actionId)) {
            return another();
        }

        self.setAction(id);
        return null;
    },

    onActionEnd: function() {
        if (this.auto) {
            this.findNewAction();
        }
    },

    onBounding: function() {
        if (this.auto) {
            this.findNewAction();
        }
    },

    createElem: function() {
        var self    = this,
            div     = document.createElement('div');

        div.className = "sheep-js";
        document.body.appendChild(div);
        self.elem = div;

        addListener(div, "mousedown", self.mouseDownDelegate);
    },

    setFrame: function(inx) {
        setFrame(this.elem, inx);
    },


    onMouseDown: function(e) {
        var self    = this;
        addListener(document.documentElement, "mousemove", self.mouseMoveDelegate);
        addListener(document.documentElement, "mouseup", self.mouseUpDelegate);

        self.stop();
        self.setFrame(50);
        self.getPosition().setFloor(null);
        self.dragging = true;

        var pos = self.getPosition();
        self.ofsX = e.clientX - pos.getX();
        self.ofsY = e.clientY - pos.getY();

        if (e.preventDefault) {
            e.preventDefault();
        }
        if (e.stopPropagation) {
            e.stopPropagation();
        }
        return false;
    },

    onMouseUp: function() {
        var self    = this,
            pos     = self.getPosition(),
            floor   = pos.findFloorBeneath(),
            rect    = getClientRect(floor);

        removeListener(document.documentElement, "mousemove", self.mouseMoveDelegate);
        removeListener(document.documentElement, "mouseup", self.mouseUpDelegate);

        self.dragging = false;
        self.setFrame(47);
        pos.animateTo(pos.getX(), rect.floor - SIZE, 1000, easings.easeInCirc, function(){
            if (self.dragging) {
                return;
            }
            self.setFrame(48);
            pos.setFloor(floor);
            window.setTimeout(function(){
                if (self.dragging) {
                    return;
                }
                self.start();
            }, 2000);
        });
    },

    onMouseMove: function(e) {
        var self = this,
            pos     = self.getPosition();
        pos.set(e.clientX - self.ofsX, e.clientY - self.ofsY);
    }

});


window.Sheep = Sheep;

